// MATERIAL UI
import { Chip } from "@material-ui/core";

// PACKAGES
import styled from "styled-components";

const OrderBillChip = styled(Chip)`
  && {
    padding: 0.1rem;
    background-color: #2c3e50;
    font-size: 1.3rem;
    font-weight: normal;
    color: #ffffff;
    float: right;
  }
`;

export default OrderBillChip;
